  \"Concentrations of elements in eggs of least terns and piping plovers from the
  Missouri River, North Dakota\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:41:33.375896\",\n\t\"name\": \"concentrations-of-elements-in-eggs-of-least-terns-and-piping-plovers-from-the-missouri-riv\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Selenium concentrations were slightly elevated
  in unsuccessful eggs of interior least terns and piping plovers from nesting areas
  along the Missouri River in North Dakota but were below concentrations associated
  with toxicity. Mercury concentrations were higher in tern eggs than in plover eggs
  but were probably not high enough to impair reproduction. With the possible exception
  of barium in plover eggs, there was no tendency for concentrations of other elements
  to be elevated in our samples. Several eggs contained elevated concentrations of
  aluminum, iron, nickel, and/or lead. It is possible that these outlaying data points
  were due to exposure of individual hens to contaminated environments. However, we
  believed it is more likely that the eggs were contaminated after being laid, either
  by natural processes in the field or in the lab. Therefore we do not plan to conduct
  special studies involving aluminum, iron, nickel, and lead. We collected forage
  fish from the vicinity of tern colonies in 1991 and plan to do this again in 1992.
  Results of chemical analyses of forage fish will be presented elsewhere. We will
  continue to monitor trace element concentrations in unsuccessful eggs of least terns
  and piping plovers from the Missouri River. We would also like to determine whether
  contaminants are affecting reproduction of piping plovers in alkali wetlands.\",\n\t\"license_title\":
